# 创建用户表 t_user
DROP TABLE IF EXISTS `t_user`;
CREATE TABLE `t_user` (
   `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键ID',
   `username` varchar(20) DEFAULT NULL COMMENT '用户名称',
   `phone` varchar(20) DEFAULT NULL COMMENT '电话号码',
   `card_no` varchar(20) DEFAULT NULL COMMENT '身份证号',
   `code` varchar(20) DEFAULT NULL COMMENT '用户编码',
   `user_type` int(11) DEFAULT NULL COMMENT '用户类型：1会员，2员工',
   `password` varchar(80) DEFAULT NULL COMMENT '密码',
   `email` varchar(50) DEFAULT NULL COMMENT '邮箱',
   `head_pic` varchar(20) DEFAULT NULL COMMENT '头像',
   `login_num` int(11) DEFAULT NULL,
   `last_login_time` datetime DEFAULT NULL COMMENT '最后登录时间',
   `last_login_ip` varchar(50) DEFAULT NULL COMMENT '最后登录IP',
   `nick_name` varchar(20) DEFAULT NULL COMMENT '昵称',
   `real_name` varchar(20) DEFAULT NULL COMMENT '真实姓名',
   `sex` varchar(5) DEFAULT NULL COMMENT '性别',
   `birthday` datetime DEFAULT NULL COMMENT '生日',
   `is_tester` tinyint(4) DEFAULT '0' COMMENT '是否为测试人员',
   `create_time` datetime DEFAULT CURRENT_TIMESTAMP,
   `create_user` int(11) DEFAULT NULL,
   `update_time` datetime DEFAULT NULL,
   `update_user` int(11) DEFAULT NULL,
   `state` tinyint(4) DEFAULT '1',
   `flag_delete` tinyint(4) DEFAULT '0',
   `version` int(11) DEFAULT '1',
   `memo` varchar(125) DEFAULT NULL,
   `invite_code` varchar(24) DEFAULT NULL COMMENT '邀请码',
   PRIMARY KEY (`id`)
 ) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='系统角色表';

# 创建角色表 t_role
DROP TABLE IF EXISTS `t_role`;
CREATE TABLE `t_role` (
   `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键ID',
   `role_code` varchar(50) NOT NULL COMMENT '角色代码',
   `role_name` varchar(50) DEFAULT NULL COMMENT '角色名称',
   `role_desc` varchar(100) DEFAULT NULL COMMENT '角色描述',
   `state` tinyint(4) DEFAULT '1' COMMENT '1有效2无效',
   `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
   `create_user` int(11) DEFAULT NULL COMMENT '创建人',
   `update_time` datetime DEFAULT NULL COMMENT '更新时间',
   `update_user` int(11) DEFAULT NULL COMMENT '更新人',
   `flag_delete` tinyint(4) DEFAULT '0' COMMENT '删除标志（0未删除1已删除）',
   `memo` varchar(512) DEFAULT NULL COMMENT '备注',
   PRIMARY KEY (`id`)
 ) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='系统角色表';

# 创建用户角色表 t_user_role
DROP TABLE IF EXISTS `t_user_role`;
CREATE TABLE `t_user_role` (
   `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键ID',
   `user_id` int(11) DEFAULT NULL COMMENT '用户ID',
   `role_id` int(11) DEFAULT NULL COMMENT '角色ID',
   `state` tinyint(4) DEFAULT '1' COMMENT '1有效2无效',
   `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
   `create_user` int(11) DEFAULT NULL COMMENT '创建人',
   `update_time` datetime DEFAULT NULL COMMENT '更新时间',
   `update_user` int(11) DEFAULT NULL COMMENT '更新人',
   `flag_delete` tinyint(4) DEFAULT '0' COMMENT '删除标志（0未删除1已删除）',
   `memo` varchar(512) DEFAULT NULL COMMENT '备注',
   PRIMARY KEY (`id`)
 ) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='用户与角色关联表';


# 创建菜单表 t_menu
DROP TABLE IF EXISTS `t_menu`;
CREATE TABLE `t_menu` (
   `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键ID',
   `parent_id` int(11) DEFAULT NULL COMMENT '父菜单ID',
   `scode` varchar(64) DEFAULT NULL COMMENT '代码',
   `menu_name` varchar(120) DEFAULT NULL COMMENT '菜单名称',
   `icon_cls` varchar(50) DEFAULT NULL COMMENT '菜单图标',
   `menu_sort` int(11) NOT NULL DEFAULT '0' COMMENT '菜单序号',
   `menu_path` varchar(200) DEFAULT NULL COMMENT '菜单路径',
   `itype` tinyint(4) DEFAULT '1' COMMENT '菜单类型：1:menu、2:btn',
   `state` tinyint(4) DEFAULT '1' COMMENT '1有效2无效',
   `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
   `create_user` int(11) DEFAULT NULL COMMENT '创建人',
   `update_time` datetime DEFAULT NULL COMMENT '更新时间',
   `update_user` int(11) DEFAULT NULL COMMENT '更新人',
   `flag_delete` tinyint(4) DEFAULT '0' COMMENT '删除标志（0未删除1已删除）',
   `memo` varchar(512) DEFAULT NULL COMMENT '备注',
   PRIMARY KEY (`id`)
 ) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='系统菜单'; 

# 创建角色菜单表 t_menu_role
DROP TABLE IF EXISTS `t_menu_role`;
CREATE TABLE `t_menu_role` (
   `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键ID',
   `menu_id` int(11) DEFAULT NULL COMMENT '菜单ID',
   `role_id` int(11) DEFAULT NULL COMMENT '角色ID',
   `state` tinyint(4) DEFAULT '1' COMMENT '1有效2无效',
   `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
   `create_user` int(11) DEFAULT NULL COMMENT '创建人',
   `update_time` datetime DEFAULT NULL COMMENT '更新时间',
   `update_user` int(11) DEFAULT NULL COMMENT '更新人',
   `flag_delete` tinyint(4) DEFAULT '0' COMMENT '删除标志（0未删除1已删除）',
   `memo` varchar(512) DEFAULT NULL COMMENT '备注',
   PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='角色菜单关联表';

# 创建系统配置表
DROP TABLE IF EXISTS `t_config`;
CREATE TABLE `t_config` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `parent_id` int(11) NOT NULL DEFAULT '0' COMMENT '父节点id',
  `sname` varchar(35) DEFAULT NULL COMMENT '参数名称',
  `sys_key` varchar(128) DEFAULT NULL COMMENT '参数的key',
  `sys_value` varchar(128) DEFAULT NULL,
  `sys_des` varchar(128) DEFAULT NULL COMMENT '参数描述',
  `state` tinyint(4) DEFAULT '1' COMMENT '1有效2无效',
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `create_user` int(11) DEFAULT NULL COMMENT '创建人',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `update_user` int(11) DEFAULT NULL COMMENT '更新人',
  `flag_delete` tinyint(4) DEFAULT '0' COMMENT '删除标志（0未删除1已删除）',
  `memo` varchar(512) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`id`),
  UNIQUE KEY `Index_sysconfig_syskey` (`sys_key`)
) ENGINE=InnoDB AUTO_INCREMENT=205 DEFAULT CHARSET=utf8 COMMENT='系统参数配置';


#地区表
DROP TABLE IF EXISTS `t_area`;
CREATE TABLE `t_area` (
   `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键ID',
   `parent_id` int(11) NOT NULL COMMENT '父id',
   `sname` varchar(256) DEFAULT NULL COMMENT '名称',
   `itype` tinyint(4) DEFAULT NULL COMMENT '1省份2城市3区县',
   `state` tinyint(4) DEFAULT '1' COMMENT '1有效2无效',
   `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
   `create_user` int(11) DEFAULT NULL COMMENT '创建人',
   `update_time` datetime DEFAULT NULL COMMENT '更新时间',
   `update_user` int(11) DEFAULT NULL COMMENT '更新人',
   `flag_delete` tinyint(4) DEFAULT '0' COMMENT '删除标志（0未删除1已删除）',
   `memo` varchar(512) DEFAULT NULL COMMENT '备注',
   `flag_hot` tinyint(4) DEFAULT '0' COMMENT '热门城市标志：1是0否',
   PRIMARY KEY (`id`)
 ) ENGINE=InnoDB  DEFAULT CHARSET=utf8 COMMENT='地区表';


